const Navbar = () => {



    return (
        <nav className="navbar">
            <h1>The Dojo Blog</h1>
            <div className="links"></div>
            <a href="/">Home</a>
            <a href="/create" style={{
                color: "white",
                backgroundColor: '#f1356d',
                /*borderRadius: '8px',*/
            }}>New Blog</a>
        </nav>
    );
}

export default Navbar;
